CREATE DATABASE IF NOT EXISTS Bayern;
USE Bayern;


CREATE TABLE Freizeitpark (
  id int(11) NOT NULL PRIMARY KEY,
  name varchar(255) DEFAULT NULL,
  gemeindeschluessel char(8) DEFAULT NULL,
  strasse varchar(200) DEFAULT NULL,
  url varchar(255) DEFAULT NULL,
  breitengrad double DEFAULT NULL,
  laengengrad double DEFAULT NULL,
  FOREIGN KEY (gemeindeschluessel) REFERENCES Gemeinde(schluessel)
) ;


CREATE TABLE Gemeinde (
  schluessel char(8) NOT NULL PRIMARY KEY,
  regierungsbezirk varchar(13) DEFAULT NULL,
  kreis varchar(100) DEFAULT NULL,
  name varchar(200) DEFAULT NULL,
  zusatz varchar(50) DEFAULT NULL,
  plz char(5) DEFAULT NULL,
  flaeche double DEFAULT NULL,
  einwohner_m int(11) DEFAULT NULL,
  einwohner_w int(11) DEFAULT NULL
) ;


CREATE TABLE Nachbargemeinde (
  gemeindeschluessel_1 varchar(8) NOT NULL,
  gemeindeschluessel_2 varchar(8) NOT NULL,
  FOREIGN KEY (gemeindeschluessel_1) REFERENCES Gemeinde(schluessel),
  FOREIGN KEY (gemeindeschluessel_2) REFERENCES Gemeinde(schluessel),
  PRIMARY KEY (gemeindeschluessel_1,gemeindeschluessel_2)
) ;


CREATE TABLE Radweg (
  name varchar(109) DEFAULT NULL,
  radweg_id varchar(6) NOT NULL PRIMARY KEY
) ;


CREATE TABLE Radweg_zu_Gemeinde (
  radweg_id varchar(6) NOT NULL,
  gemeindeschluessel varchar(8) NOT NULL,
  PRIMARY KEY (radweg_id,gemeindeschluessel),
  FOREIGN KEY (radweg_id) REFERENCES Radweg(id)
  FOREIGN KEY (gemeindeschluessel) REFERENCES Gemeinde(schluessel)
) ;


CREATE TABLE Schwimmbad (
  id int(11) NOT NULL PRIMARY KEY,
  name varchar(255) DEFAULT NULL,
  art varchar(200) DEFAULT NULL,
  gemeindeschluessel char(8) DEFAULT NULL,
  strasse varchar(200) DEFAULT NULL,
  url varchar(255) DEFAULT NULL,
  breitengrad double DEFAULT NULL,
  laengengrad double DEFAULT NULL,
  FOREIGN KEY (gemeindeschluessel) REFERENCES Gemeinde(schluessel)
) ;


CREATE TABLE Wanderweg (
  name varchar(255) DEFAULT NULL,
  wanderweg_id varchar(6) NOT NULL PRIMARY KEY
);


CREATE TABLE Wanderweg_zu_Gemeinde (
  wanderweg_id varchar(6) NOT NULL,
  gemeindeschluessel varchar(8) NOT NULL,
  PRIMARY KEY (wanderweg_id,gemeindeschluessel)
  FOREIGN KEY (wanderweg_id) REFERENCES Wanderweg(id)
  FOREIGN KEY (gemeindeschluessel) REFERENCES Gemeinde(schluessel)
) ;


CREATE TABLE Zoo (
  id int(11) NOT NULL PRIMARY KEY,
  name varchar(255) DEFAULT NULL,
  gemeindeschluessel char(8) DEFAULT NULL,
  strasse varchar(200) DEFAULT NULL,
  url varchar(255) DEFAULT NULL,
  breitengrad double DEFAULT NULL,
  laengengrad double DEFAULT NULL,
  FOREIGN KEY (gemeindeschluessel) REFERENCES Gemeinde(schluessel)
) ;



